import React from 'react';
import Layout from './Layout';
import { Switch, Route } from 'react-router-dom'
import Login from './Login'

function App() {
  return (
    <Layout>
      <Switch >
        <Route exact path="/login" component={Login} />
      </Switch>
    </Layout>
  );
}

export default App;
